import java.util.*;

/**
 * Runtime: 29 ms, faster than 36.91% of Java online submissions for Sort Characters By Frequency.
 * Memory Usage: 55 MB, less than 19.09% of Java online submissions for Sort Characters By Frequency.
 */
public class N451_SortCharactersByFrequency {

    public static void main(String[] args) {


        Solution solution = new Solution();
        String s = "";
        System.out.println(solution.frequencySort(s));
    }

    static class Solution {
        public String frequencySort(String s) {
            HashMap<Character, Integer> charCounts = new HashMap<>();
            StringBuilder result = new StringBuilder();

            for(int i = 0; i < s.length(); i++){
                charCounts.put(s.charAt(i), charCounts.getOrDefault(s.charAt(i), 0) + 1);
            }

            Set<Integer> countSet = new HashSet<>(charCounts.values());
            Integer[] countArray = new Integer[countSet.size()];
            countSet.toArray(countArray);
            Arrays.sort(countArray);
            System.out.println(Arrays.toString(countArray));
            System.out.println(charCounts);

            //次數
            for(int i = countArray.length - 1; i >= 0; i--){
                for(Character c : charCounts.keySet()){
                    if(Objects.equals(charCounts.get(c), countArray[i])){

                        for(int j = 0; j < countArray[i]; j++){
                            result.append(c);
                        }
                    }
                }
            }
            return result.toString();
        }
    }
}
